    resultado.push(i +"= " +Object.values(conteudo)[x]);
    }
    x++
}
return resultado
}

function Informacoes(props){
console.log(props)    
    return(
        <div className='informacoes'>
            {
                eae(props.informacoes).map((conteudo) =>{
                        return ( <h1> {conteudo} </h1>)
                })
            }
